import React from "react";
import { Navbar, Container, Nav, Button } from "react-bootstrap";

const Header = () => {
  return (
    <Navbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand href="/">Mashina.kg</Navbar.Brand>
        <Nav className="ms-auto">
          <Nav.Link href="/bazar">Bazar.kg</Nav.Link>
          <Nav.Link href="/house">House.kg</Nav.Link>
          <Button variant="outline-primary" className="mx-2">Вход</Button>
          <Button variant="primary">Регистрация</Button>
        </Nav>
      </Container>
    </Navbar>
  );
};

export default Header;
